CREATE TABLE "CLOCK_GENERATION" 
(
    "ID" SERIAL PRIMARY KEY,
    "Product (WPN)"	VARCHAR(512),
    "Datasheet"	VARCHAR(512),
    "OPN"	VARCHAR(512),
    "Price"	FLOAT,
    "Description"	VARCHAR(512),
    "Input Interface Logic"	VARCHAR(512),
    "Output Interface Logic"	VARCHAR(512),
    "fout Typ (MHz)"	FLOAT,
    "fin Typ (MHz)"	FLOAT,
    "VCC Typ (V)"	FLOAT,
    "Package Type"	VARCHAR(512),
    "tJitter(Cy-Cy) Typ (ps)"	INT,
    "tJitter(Period) Typ (ps)"	FLOAT,
    "tJitter(&#934;) Typ (ps)"	FLOAT,
    "tR & tF Typ (ps)"	INT,
    "tR & tF Max (ps)"	INT,
    "TA Min (°C)"	INT,
    "TA Max (°C)"	INT,
    "Qualification"	VARCHAR(512),
    "AEC Qualified"	BOOLEAN,
    "PPAP Capable"	BOOLEAN,
    "Halide Free"	BOOLEAN,
    "Lead Free"	BOOLEAN,
    "Status"	VARCHAR(512)
);

